namespace Client2.Extensions
{
    using System;
    using System.Linq;
    using System.Collections;
    using System.Collections.Generic;
    using System.Net.Http;
    using System.Net.Http.Json;
    using System.Threading.Tasks;
    using Client2.Models;
    using System.Net;
    using System.IO;
    using System.Text;
    public static class TypeEnhancements {
        static Random rnd = new Random(23);

        public static string ToBase64(this byte[] value){
            return $"data:image/jpg;base64,{Convert.ToBase64String (value)}";
        }
        public static async Task<string> FileToBase64(Stream stream, string type)
        {
            var buffers = new byte[stream.Length];
            await stream.ReadAsync(buffers);
            return $"data:{type};base64,{Convert.ToBase64String(buffers)}";
        }
        public static AnnouncementT getRandomeAnn(){
            return new AnnouncementT {
                id = rnd.Next(1, 10),
                price = rnd.Next(1000, 10000),
                type = "Colocation",
                house = getRandomeHou(),
                AvgRating = (int)Enumerable.Range(1, 5).Select(i => rnd.Next(1, 10)).Average()
            };
        }
        public static ReviewT getRandomRev(){
            return new ReviewT {
                id = rnd.Next(0,10),
                rating = rnd.Next(0,6),
                announcementID = rnd.Next(1,10)
            };
        }
        public static HouseT getRandomeHou(){
            return new HouseT {
                id = rnd.Next(1, 10),
                bathroomsC = rnd.Next(1, 10),
                bedroomsC = rnd.Next(1, 10),
                description = $"description{rnd.Next(0,7)}",
                number = rnd.Next(1, 10),
                roomC = rnd.Next(1, 10),
                surface = rnd.Next(10,100) / 10,
                rules = Enumerable.Range(0,rnd.Next(10)).Select(_ => getRandomRul()).ToArray(),
                pictures = Enumerable.Range(1,rnd.Next(1,3)).Select(_ => getRandomImg()).ToArray(),
                address = getRandomeAdd()
            };
        }
        public static AddressT getRandomeAdd(){
            return new AddressT {
                id = rnd.Next(1, 10),
                city = $"city{rnd.Next(0,7)}",
                street = $"{rnd.Next(0,7)}th st",
                zip = $"{rnd.Next(0,7)}"
            };
        }
        public static UserT getRandomePer(){
            return new UserT {
                id = rnd.Next(1, 10),
                email = $"{rnd.Next(0,7)}@gmail.com",
                firstName = $"fstName{rnd.Next(0,7)}",
                lastName = $"lstName{rnd.Next(0,7)}",
                gender = rnd.Next(2) == 0 ? "Female" : "Male",
                password = $"{rnd.Next(1000000,99999999)}",
                role = rnd.Next(2) == 0 ? State.Renter : State.Rentee,
            };
        }
        public static RuleT getRandomRul(){
            return new RuleT {
                id = rnd.Next(1, 10),
                penalty = rnd.Next(1, 100),
                ruleBody = $"ruleBody{rnd.Next(0,7)}",
            };
        }
        public static ReservationT getRandomRes(){
            return new ReservationT {
                id = rnd.Next(1, 10),
                startPeriod = DateTime.Now,
                endPeriod = DateTime.Now.AddDays(rnd.Next(1, 10)),
                createdAt = DateTime.Now,
                users = Enumerable.Range(0,rnd.Next(10)).Select(_ => getRandomePer()).ToArray(),
                owner = getRandomePer(),
                announcementId = rnd.Next(1, 10)
            };
        }
        public static PictureT getRandomImg(){
            var datas = new List<string>(){
                "",
                "",
                "",
                "",
            };
            return new PictureT {
                id = rnd.Next(1, 10),
                // add a random base64 string of an image
                data = $"data:image/jpg;base64,{datas.ElementAt((new Random()).Next(datas.Count))}"
           };
        }
    }
}